    // .then(res => this.setState({apiReturn: res}))

    localStorage.getItem("userData") && this.setState({
      userData: JSON.parse(localStorage.getItem("userData"))
    })
  }

  render(){
    const {userData} = this.state;

    return (
      <div className="App">
        <Nav userName="Douglas Ciole 2" />
        <SignupPage />

        <Footer />
      </div>
    )
  }
}

export default App;
